import React from 'react';

import profile from '../../assets/images/icons/user.svg';

import './styles.css';

function Form(){
    return(
        <article className="teacher-item">
        <header>
            <img src={profile} alt="Insira sua foto de perfil"/>
            <p>Insira seu nome</p>
        </header>
             
             <footer>

             
                
                 {/* <button type="button">
                     <img src="{whatsappIcon}" alt="whatsapp"/>
                     <p> Entrar em contado </p>
                 </button> */}
             </footer>
    </article>
    
    );


}


export default Form;
